// import {Header} from './Header.jsx'
import './App.css';
function App() {
  <script src="https://kit.fontawesome.com/8acce5eeb9.js" crossorigin="anonymous"></script>
  return (

    <div className="App">
      <nav className="app_header">
        <div className="logo">
          <a href="">TaeTaeBlog</a>
        </div>
        <div className="search">
          <button className="search_button">
            검색
          </button>
        </div>
        <ul className="menu">
          <li><a href="">공동구매</a></li>
          <li><a href="">로그인</a></li>
          <li><a href="">회원가입</a></li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
